export const FIND_TRACKS_FOR_PLAYLIST = "FIND_TRACKS_FOR_PLAYLIST";

export const findTracksForPlaylist = (dispatch, playlist) => {
	// Add service call here
	const tracks = "";
	dispatch({
		type: FIND_TRACKS_FOR_PLAYLIST,
		tracks,
	});
};
